import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
  tableHead: {
    fontSize: '20px'
  },
  tableItem: {
    fontSize: '18px'
  },
  card: {
    marginTop: '2.5%',

  },
  title: {
    // textAlign: 'center',
    fontWeight: 'bold',
    fontSize: '35px',
    margin: '25px 0 -4rem 0',
    color: 'White',
    backgroundColor: '#4D94C8',
    textAlign: 'center',
    borderRadius: '10em 10em 10em'
  },
  subtitle: {
    fontWeight: 'bold',
    fontSize: '28px',
    // marginLeft: '5px',
    color: '#4C4C4C',
    marginBottom: '10px',
    marginTop: '20px',
    textAlign: 'center'
  },
  display: {
    textAlign: 'center',
    fontWeight: 'bold',
    fontSize: '35px',
    marginTop: '5px',
    // color: '#4D94C8',
    color: 'white',
    margin: '-4rem -4rem -4rem -4rem'
  },
  overviewText: {
    fontWeight: 'bold',
    fontSize: '20px',
    textAlign: 'center',
    marginBottom: '10px'
  },
  overview: {
    margin: '0 -2.5rem 1rem -2.5rem',
  },
  circle: {
    borderRadius: '100%',
    backgroundColor: '#4D94C8',
    height: '85px',
    width: '85px',

  },
  center: {
    width: '50%',
    margin: 'auto',
    padding: '10.5px',
  }
}));
